//if port is modified it requires modification in the backend application.properties of variable server.port
const BASE_URL = "http://localhost:8080/api";
const CATEGORIES = ["Dog", "Cat", "Bird", "Duck", "Reptiles", "Fish", "Rabbit", "Guinea Pigs", "Hamster", "Gerbil", "Ferret", "Hedgehog", "Pig", "Horse"];
export default BASE_URL; CATEGORIES;
